script: |
  super -f text -I q5886.spq | sort > q5886.out

inputs:
  - name: q5886.spq
    data: |
      SELECT DISTINCT + ( - col1 ) + - tab2.col2 / ( - col0 * - col1 ) + 50 * col1 AS col1 FROM tab2 (FORMAT parquet);
  - name: tab2

outputs:
  - name: q5886.out
    data: |
      1519
      2891
      833
